import axios from 'axios';

const API_URL = 'http://localhost:5050/api';

export async function fetchTrips() {
  try {
    const response = await axios.get(`${API_URL}/trips`);
    return response.data;
  } catch (error) {
    console.error('Error fetching trips:', error);
    return [];
  }
}

export async function fetchTopBookedTrips() {
    try {
      const response = await axios.get(`${API_URL}/trips/top-booked`);
      return response.data;
    } catch (error) {
      console.error('Error fetching top booked trips:', error);
      return [];
    }
  }

export async function fetchTopRatedTrips() {
  try {
    const response = await axios.get(`${API_URL}/trips/top-rated`);
    return response.data;
  } catch (error) {
    console.error('Error fetching top rated trips:', error);
    return [];
  }
}
